import ExpenseItem from "./ExpenseItem";

function ExpenseItemBox(props) {
    return (
        <div className="expenses">
            <ExpenseItem title={title[0].title} amount={amount[0].amount} date={date[0].date} />
            <ExpenseItem title={title[1].title} amount={amount[1].amount} date={date[1].date} />
            <ExpenseItem title={title[2].title} amount={amount[2].amount} date={date[2].date} />
            <ExpenseItem title={title[3].title} amount={amount[3].amount} date={date[3].date} />
        </div>
    );
}

export default ExpenseItemBox;
